import React from 'react';
import logo from "../assets/Logo.png";
import styles from "./Sidebar.module.css";
import { FaMicrosoft,FaTicketAlt } from "react-icons/fa";
import { FaLocationDot,FaGamepad } from "react-icons/fa6";


export default function Sidebar() {
  return (
    <div className={styles.sidebar}>
        <div>
            <img className={styles.logo} src={logo} alt='chaabi'/>
        </div>
        <div>
            <div className={styles.icons}><FaMicrosoft/> <p style={{marginLeft:""}}>Dashboard</p></div>
            <div className={styles.icons}><FaGamepad/> <p>Training</p></div>
            <div className={styles.icons}><FaTicketAlt/> <p>Users</p></div>
            <div className={styles.icons}><FaLocationDot/> <p>Analytics</p></div>
            <div className={styles.icons}><FaLocationDot/> <p>My Account</p></div>
            <div className={styles.icons}><FaLocationDot/> <p>Support</p></div>
            
        </div>
    </div>
  )
}
